SELECT COUNT(*) FROM aka_title AS at ,cast_info AS ci ,char_name AS ch_n ,comp_cast_type AS cct ,company_name AS cn ,company_type AS ct ,complete_cast AS cc ,info_type AS it ,keyword AS k ,kind_type AS kt ,movie_companies AS mc ,movie_info AS mi ,movie_info_idx AS mi_idx ,movie_keyword AS mk ,name AS n ,role_type AS rt ,title AS t  WHERE cct.id=cc.subject_id AND ci.person_id=n.id AND ci.person_role_id=ch_n.id AND ci.role_id=rt.id AND cn.id=mc.company_id AND ct.id=mc.company_type_id AND k.id=mk.keyword_id AND mi_idx.info_type_id=it.id AND t.id=at.movie_id AND t.id=cc.movie_id AND t.id=ci.movie_id AND t.id=mc.movie_id AND t.id=mi.movie_id AND t.id=mi_idx.movie_id AND t.id=mk.movie_id AND t.kind_id=kt.id AND n.name IS NOT NULL  AND t.phonetic_code IS NOT NULL  AND at.phonetic_code != 'O1515' AND rt.id != 5 AND ci.nr_order > 28 AND ct.id = 1 AND n.surname_pcode NOT IN ('C361','P565','K123','P123') ;
SELECT COUNT(*) FROM aka_name AS an ,cast_info AS ci ,char_name AS ch_n ,name AS n  WHERE ci.person_id=n.id AND ci.person_role_id=ch_n.id AND n.id=an.person_id AND ch_n.id >= 79770 AND ch_n.md5sum != 'ca7f7125abd7e08248e2b98a988b918d' AND an.person_id < 502272 ;
SELECT COUNT(*) FROM aka_title AS at ,cast_info AS ci ,kind_type AS kt ,movie_companies AS mc ,role_type AS rt ,title AS t  WHERE ci.role_id=rt.id AND t.id=at.movie_id AND t.id=ci.movie_id AND t.id=mc.movie_id AND t.kind_id=kt.id AND at.season_nr IS NULL  AND ci.person_role_id <= 2051609 AND ci.person_id >= 1641290 AND kt.kind IN ('movie') AND rt.id = 1 AND at.id <= 377375 AND t.season_nr IS NULL  ;
SELECT COUNT(*) FROM aka_title AS at ,comp_cast_type AS cct ,company_name AS cn ,company_type AS ct ,complete_cast AS cc ,info_type AS it ,keyword AS k ,kind_type AS kt ,movie_companies AS mc ,movie_info AS mi ,movie_info_idx AS mi_idx ,movie_keyword AS mk ,title AS t  WHERE cct.id=cc.subject_id AND cn.id=mc.company_id AND ct.id=mc.company_type_id AND k.id=mk.keyword_id AND mi_idx.info_type_id=it.id AND t.id=at.movie_id AND t.id=cc.movie_id AND t.id=mc.movie_id AND t.id=mi.movie_id AND t.id=mi_idx.movie_id AND t.id=mk.movie_id AND t.kind_id=kt.id AND at.note IN ('(USA) (DVD box title)','(Australia) (informal alternative title)','(Switzerland: Swiss German title) (long title)','(International: English title) (premiere title)') AND at.title IS NOT NULL  AND t.md5sum IS NOT NULL  ;
SELECT COUNT(*) FROM aka_title AS at ,company_type AS ct ,complete_cast AS cc ,info_type AS it ,kind_type AS kt ,movie_companies AS mc ,movie_info AS mi ,movie_info_idx AS mi_idx ,movie_keyword AS mk ,title AS t  WHERE ct.id=mc.company_type_id AND mi_idx.info_type_id=it.id AND t.id=at.movie_id AND t.id=cc.movie_id AND t.id=mc.movie_id AND t.id=mi.movie_id AND t.id=mi_idx.movie_id AND t.id=mk.movie_id AND t.kind_id=kt.id AND mi.movie_id = 2371018 AND mk.id >= 3807406 AND t.season_nr IS NULL  AND at.title IS NOT NULL  AND mc.company_id != 234459 ;
